    e.preventDefault();
    if (!formData.nr || !formData.name) {
      alert('Bitte Nummer und Name ausfuellen');
      return;
    }
    await onSubmit({
      nr: parseInt(formData.nr),
      name: formData.name,
      beschreibung: formData.beschreibung,
      status: formData.status
    });
    setFormData({
      nr: '',
      name: '',
      beschreibung: '',
      status: 'offen'
    });
  };

  return (
    <div className="glass-heavy rounded-2xl p-8 mb-10 transition-all duration-300 border border-glassBorder shadow-glass">
      <div className="flex items-center gap-3 mb-6">
        <div className="p-2 bg-primary/20 rounded-lg">
