            <input
              type="number"
              id="nr"
              value={formData.nr}
              onChange={(e) => setFormData({ ...formData, nr: e.target.value })}
              className="w-full p-3 rounded-lg bg-black/30 border border-gray-600 text-white placeholder:text-gray-500 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent transition-all"
              placeholder="Eindeutige Nummer"
              required
            />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-300 mb-2" htmlFor="status">Status</label>
            <Select
              value={formData.status}
              onValueChange={(value) => setFormData({ ...formData, status: value })}
            >
              <SelectTrigger id="status" className="bg-black/30 border-gray-600 text-white focus:ring-blue-500">
                <SelectValue placeholder="Status waehlen" />
              </SelectTrigger>
              <SelectContent>
                <SelectItem value="offen">Offen</SelectItem>
                <SelectItem value="in Arbeit">In Arbeit</SelectItem>
                <SelectItem value="erledigt">Erledigt</SelectItem>
              </SelectContent>
            </Select>
          </div>
        </div>
        <div>
          <label className="block text-sm font-medium text-gray-300 mb-2" htmlFor="name">Name *</label>
          <input
            type="text"
            id="name"
            value={formData.name}
            onChange={(e) => setFormData({ ...formData, name: e.target.value })}
            className="w-full p-3 rounded-lg bg-black/30 border border-gray-600 text-white placeholder:text-gray-500 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent transition-all"
            placeholder="Kurzer Name oder Titel"
            required
          />
        </div>
        <div>
          <label className="block text-sm font-medium text-gray-300 mb-2" htmlFor="beschreibung">Beschreibung</label>
          <textarea
            id="beschreibung"
            value={formData.beschreibung}
            onChange={(e) => setFormData({ ...formData, beschreibung: e.target.value })}
